import './ExpenseForm.css';

function ExpenseForm() {
  return (
    <form>
      <div>
        <div>
          <label>Title</label>
          <input type="text"></input>
        </div>
        <div>
          <label>Amount</label>
          <input type="number" min={0.01} step={0.01}></input>
        </div>
        <div>
          <label>Date</label>
          <input type="date" min="2019-01-01" max="2022-12-31"></input>
        </div>
      </div>
    </form>
  );
}

export default ExpenseForm;
